import { useState, useEffect } from "react"
import axios from "axios";
import Add_Form from "./add_component";

       

const View_Data = ()=> {
    const [data,setData] = useState([])
    function getData(){
        axios.get('https://687632cc814c0dfa653b18fc.mockapi.io/user').then((res)=>{
            console.log(res.data);
            setData(res.data)
        })
    }
    // delHandler
    const delHandler = (id)=>

    useEffect(()=>{
        getData()
    },[])
    return (
    <>
    <Add_Form />
    <div className="view_component">
         <h1>view form</h1>
         <table className="view_Table"></table>

    <table>
        <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Email</th> 
            <th>Phone</th>
            <th>Delete</th>
            <th>Update</th>
        </tr>
        {
            data.map((item)=>(

                <tr>
                    <td>{item.id}</td>
                    <td>{item.name}</td>
                    <td>{item.email}</td>
                    <td>{item.phone}</td>
                    <td><button className="del_btn" onClick={()=> delHandler(item.id)}>Delete</button></td>
                     <td><button className="up_btn">Update</button></td>
                    </tr>
            )

            )
        }


    </table>


    </div>
    

  
    
    </>
    );
} 
export default View_Data;
